module.exports = "<app-navbar></app-navbar>\n<div class=\"wrapper\">\n  <div class=\"container\">\n    <div class=\"info\">\n      <div class=\"download\">\n        <div class=\"image\">\n          <img src=\"../../assets/img/PFA.png\" />\n        </div>\n        <button mat-raised-button color=\"primary\" (click)=\"downloadPFA()\">Download PFA Pro</button>\n      </div>\n      <div class=\"content\">\n        In recent times, a lot of commercial software have been developed based on the finite element method (FEM). Engineers who\n        use these applications always seem to see these programs as little ‘black boxes’ and sometimes revert to manual calculations\n        to verify their calculations. What is most interesting is that a lot more engineers use these programs without having\n        fully grasped the full concept of the finite element method, thus are unable to easily tell when the program is not\n        churning out the right results There is the need, therefore, to translate the theory of the FEM into an implementable\n        algorithm. This project was for the formulation of an algorithm for the Global System Matrices for 2-D plane frame\n        structures. This was further extended into a standalone application using Visual Basic .Net, PFA 2-D Pro for analysis\n        of stresses, member forces, reactions and other relevant parameters for the bar and truss element. The beam element,\n        a specialized frame element, as well as the general frame element is also considered.\n      </div>\n    </div>\n    <div class=\"divider\"></div>\n    <div class=\"info\">\n      <div class=\"download\">\n        <div class=\"image\">\n          <img src=\"../../assets/img/pdf_download.jpg\" />\n        </div>\n        <button mat-raised-button color=\"primary\" (click)=\"downloadReport()\">Download Documentation</button>\n      </div>\n      <div class=\"content\">\n        The PFA 2-D program has been developed with very user friendly steps. Any individual conversant with how to manually analyze\n        a structure using the stiffness matrix approach will find it very easy to use. The basic steps involved in using\n        it are presented below.\n        <h3>Step One</h3>\n        User chooses which element type analysis is based on and clicks next to proceed.\n        <div class=\"image\">\n          <img src=\"../../assets/img/pfa_step1.png\" />\n        </div>\n        <h3>Step Two</h3>\n        User specifies the number of nodes and elements the structure is made up of\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step2.png\" />\n        </div>\n        <h3>Step Three</h3>\n        The coordinates for the nodes is specified in the global coordinate system.\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step3.png\" />\n        </div>\n        <h3>Step Four</h3>\n        User specifies the boundary conditions for the nodes and supplies support settlement or rotation values, if any\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step4.png\" />\n        </div>\n        <h3>Step Five</h3>\n        The user provides the element-node connectivity information as well as some element properties such as:\n        <ul>\n          <li>Element Cross-Sectional Area</li>\n          <li>Element Moment of Inertia</li>\n          <li>Element Modulus of Elasticity</li>\n        </ul>\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step5.png\" />\n        </div>\n        <h3>Step Six</h3>\n        If the analysis involves element loadings, they will also have to be specified. The following element \n        loadings have been incorporated in the program:\n        <ul>\n          <li>The uniformly distributed load</li>\n          <li>The point load</li>\n          <li>Triangular loads</li>\n          <li>Trapezoidal load</li>\n        </ul>\n        With an element having a triangular load on it for instance, the user first selects the element, and specifies the element load type as triangular. \n        Finally the orientation of the load ordinate as well as the load ordinated value is specified. This is shown in the Figure below\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step6.png\" />\n        </div>\n        The results of the analysis is then finally presented - first the formulated global stiffness matrix\n        and then other output values such as stresses, forces and reactions. The results can then be saved\n        or printed out.\n        <div class=\"image\">\n            <img src=\"../../assets/img/pfa_step7.png\" />\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n"

